import TodoApp from './TodoApp';

function App() {
  return (
    <div className="App">
      <div className="container">
        <h1>TODO LIST APP</h1>
        <form className="todoForm">
          <input type="text" placeholder="Enter the Task"/>
          <button>Add Task</button>
        </form>
        <ul>
          <li>
            <span>Learn React js</span>
            <button>Edit</button>
            <button>Delete</button>
          </li>
        </ul>
     </div>
    </div>

  );
}

export default App;
